INSERT INTO `immobilien` (`id`, `bezeichnung`, `sonstiges`, `strasse`, `wohnflaeche`, `raeume`, `geldbetrag`, `k_grundstuecksgroesse`, `k_provision`, `v_nebenkosten`, `balkon_vorhanden`, `fahrstuhl_vorhanden`, `l_plz_id`, `stadt`, `user_id`, `l_art_id`, `l_heizungsart_id`, `angelegt_am`, `aktualisiert_am`, `angelegt_von`, `aktualisiert_von`) VALUES
(1, '<p><u><strong>Objektbeschreibung:</strong></u></p>\r\n\r\n<p>Dieses idyllisch gelegene Objekt<br />\r\nbefindet sich in bevorzugter,<br />\r\nruhiger Lage und bietet<br />\r\nmit seinen 6-7 Wohnungen<br />\r\njede Menge Platz. Somit<br />\r\neignet es sich perfekt<br />\r\nf&uuml;r die gro&szlig;e Familie<br />\r\noder auch f&uuml;r die Untervermietung.</p>\r\n\r\n<p>Die Gesamtfl&auml;che betr&auml;gt ca. 600 qm.</p>\r\n\r\n<p>Das riesige idyllische Gartengrundst&uuml;ck<br />\r\nvon ca. 7.500 qm verf&uuml;gt &uuml;ber einen<br />\r\nBrunnen,mehrere Teiche, einen gro&szlig;z&uuml;gigen Baumbestand,<br />\r\nB&auml;che, verschieden angelegte G&auml;rten<br />\r\nund eignet sich aufgrund der<br />\r\nGr&ouml;&szlig;e und Beschaffenheit ideal<br />\r\nf&uuml;r Tierhaltung.<br />\r\nDas Grundst&uuml;ck beinhaltet ca. 6500<br />\r\nqm Gartenland und ca. 1000 qm<br />\r\nBauland. Es befinden sich auch noch freie<br />\r\nFl&auml;chen die gegebenenfalls noch bebaut werden k&ouml;nnen.<br />\r\nAuf dem Grundst&uuml;ck befinden sich<br />\r\nau&szlig;erdem mehrere Unterstellm&ouml;glichkeiten f&uuml;r<br />\r\nTierhaltung und Fahrzeuge.<br />\r\nVor dem Haus befindet sich eine<br />\r\ngepflasterte Hoffl&auml;che. Das Grundst&uuml;ck ist<br />\r\n&uuml;ber eine Einfahrt befahrbar.<br />\r\nBei dem Haus handelte es sich<br />\r\nurspr&uuml;nglich um eine im Jahre 1890<br />\r\nerrichtetes Fachwerkhaus. Dieses wurde nach<br />\r\nund nach renoviert und erweitert.<br />\r\nBei den Fenstern handelt es sich<br />\r\num doppelt verglaste Holz- und Kunststofffenster.<br />\r\nEin Schornstein in dem bereits<br />\r\nbeide Z&uuml;ge verrohrt sind bietet<br />\r\ndie M&ouml;glichkeit auf eine andere Heizungsart umzur&uuml;sten.<br />\r\nBei der Zufahrtstr. Handelt es sich<br />\r\num eine Privatstr. Welche zu 1/3 zum Grundst&uuml;ck geh&ouml;rt.</p>\r\n', '<p><u><strong>Energieausweis:</strong></u></p>\r\n\r\n<p>Art: Bedarfsausweis<br />\r\nG&uuml;ltig bis: 20.05.2028<br />\r\nEndenergiebedarf: 270.70 kWh/(m&sup2;*a)<br />\r\nBaujahr lt. Energieausweis: 1979<br />\r\nWesentlicher Energietr&auml;ger: &Ouml;l</p>\r\n\r\n<p><u><strong>Lage:</strong></u></p>\r\n\r\n<p>Der Ortsteil Fohlenplacken liegt als kleines<br />\r\nDorf rund 1,5 km (Luftlinie) nordwestlich<br />\r\nvom Ortskern Neuhaus entfernt.<br />\r\nDas Haus befindet sich in unmittelbarer<br />\r\nN&auml;he vom Flusslauf der Holzminde.<br />\r\nDas Objekt zeichnet sich durch<br />\r\nseine N&auml;he zur der sch&ouml;nen Natur aus.<br />\r\nAngrenzende Naturschutzgebiete machen das Wohnen<br />\r\nund Leben zu einem echten Erlebnis.<br />\r\nDie benachbarte Stadt Holzminden verf&uuml;gt<br />\r\n&uuml;ber eine gute Infrastruktur.<br />\r\nSchulen, Kinderg&auml;rten, Einkaufsm&ouml;glichkeiten, Vereine<br />\r\nund &Auml;rzte befinden sich in unmittelbarer N&auml;he.<br />\r\nDie Bundesstra&szlig;e ist mit dem Auto gut zu erreichen.</p>\r\n', 'Tannenweg 5', 225, 8, '1880000', 330, '4.25', NULL, 1, 1, 8168, 'Asbach', 4, 2, 1, '2019-02-16 09:00:21', '2019-04-03 19:45:10', NULL, 4),
(2, '<p><u><strong>Objektbeschreibung:</strong></u></p>\r\n\r\n<p>Willkommen im Architekturhimmel<br />\r\nf&uuml;r allerh&ouml;chste Anspr&uuml;che...<br />\r\nDiese Wohnresidenz bietet traumhaften<br />\r\nWohnkomfort auf 255 qm mit<br />\r\nherrlichem Blick ins Naturschutzgebiet.<br />\r\nH&ouml;chste Qualit&auml;t, edelste Materalien und<br />\r\nviel Liebe zum Detail schaffen meisterhaft<br />\r\ninszenierte R&auml;ume mit Deckenh&ouml;hen von 3,00 m.<br />\r\nDie gro&szlig;z&uuml;gigen Loggien sind<br />\r\nso angeordnet, dass sie ein Maximum<br />\r\nan Privatsph&auml;re und an Ausblick bieten....<br />\r\n3 PKW-Stellpl&auml;tze in der Tiefgarage<br />\r\nk&ouml;nnen f&uuml;r je 80 &euro; / Monat dazugemietet werden.<br />\r\nF&uuml;hlen Sie sich angesprochen?</p>\r\n', '<p><u><strong>Energieausweis</strong></u></p>\r\n\r\n<p>Art: Bedarfsausweis<br />\r\nG&uuml;ltig bis: 15.10.2025<br />\r\nEndenergiebedarf: 39.00 kWh/(m&sup2;*a)<br />\r\nWesentlicher Energietr&auml;ger: Gas<br />\r\nKlasse: A</p>\r\n\r\n<p><u><strong>Lage:</strong></u></p>\r\n\r\n<p>HIMMLISCHE RUHE UND VIEL GR&Uuml;N....<br />\r\nIsernhagen-S&uuml;d z&auml;hlt zu den besten<br />\r\nund begehrtesten Wohnlagen Hannovers.&nbsp;<br />\r\nDer besondere Vorzug ist die Symbiose aus<br />\r\nhervorragender st&auml;dtischer Infrastruktur<br />\r\nund l&auml;ndlicher Lage.<br />\r\nEinkaufsm&ouml;glichkeiten, &Auml;rzte und Kindergarten<br />\r\nsowie<br />\r\ndie Stadtbahn sind fu&szlig;l&auml;ufig zu erreichen.</p>\r\n', 'Industriestr. 8', 225, 12, '990000', 310, '3.75', NULL, 1, 0, 5436, 'Surwold', 4, 2, 2, '2019-02-16 09:04:21', '2019-02-16 09:04:21', NULL, NULL),
(3, '<p><strong><u>Objektbeschreibung</u></strong></p>\r\n\r\n<ul>\r\n	<li>Asylanten-oder Gastarbeiterunterkunft</li>\r\n	<li>WC und Dusche seperat (auf der Etage)</li>\r\n	<li>Gemeinschaftsk&uuml;che</li>\r\n	<li>Schimmelbefall im Bad und in der K&uuml;che</li>\r\n</ul>\r\n', '<p><u><strong>Energieausweise: </strong></u>keine vorhanden</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Buchholzer Kirchweg 25', 18, 1, '220', NULL, NULL, '80.00', 0, 0, 5853, 'Bothfeld, Groß Buchholz, List,Misburg-Nord', 4, 1, 3, '2019-02-16 09:07:36', '2019-02-16 09:07:36', NULL, NULL),
(4, '<p><u><strong>Objektbeschreibung:</strong></u></p>\r\n\r\n<p>Gro&szlig;z&uuml;giges Reihenhaus mit offener Architektur in Misburg!<br />\r\nSie suchen Ihr neues Zuhause in toller Lage?<br />\r\nDann haben wir hier genau das Richtige f&uuml;r Sie.<br />\r\nDas Objekt wurde 1983 erbaut, jedoch laufend modernisiert.<br />\r\nBesonders interessant ist bei der Lage<br />\r\ndie ausgesprochen niedrige Erbpacht von<br />\r\n&euro; 1.680 j&auml;hrlich. Der Erbbaurechtsvertrag<br />\r\nhat noch eine Laufzeit bis 2070.<br />\r\nTreten Sie ein und sp&uuml;ren Sie Schritt f&uuml;r<br />\r\nSchritt, warum das Wohnen hier so angenehm ist</p>\r\n', '<p><u><strong>Energieausweis</strong></u><br />\r\nArt: Verbrauchsausweis<br />\r\nG&uuml;ltig bis: 19.03.2027<br />\r\nEndenergieverbrauch: 126.25 kWh/(m&sup2;*a)<br />\r\nBaujahr lt. Energieausweis: 2007<br />\r\nWesentlicher Energietr&auml;ger: Gas</p>\r\n\r\n<p><u><strong>Lage:</strong></u></p>\r\n\r\n<p>Misburg-Nord liegt an der &ouml;stlichen<br />\r\nStadtgrenze von Hannover.&nbsp;<br />\r\nEs ist der gr&ouml;&szlig;te Stadtteil<br />\r\nmit Bezirk Misburg-Anderten, verf&uuml;gt &uuml;ber<br />\r\neine gute Infrastruktur und wirkt<br />\r\nfast schon wie eine unabh&auml;ngige Kleinstadt.&nbsp;<br />\r\n&Uuml;ber die n&ouml;rdlich des Wohngebietes<br />\r\nverlaufende A2<br />\r\nund den Messeschnellweg kommt man mit<br />\r\ndem PKW schnell in das<br />\r\nUmland oder das Stadtzentrum von Hannover,<br />\r\n&Ouml;ffentliche Verkehrsmittel stehen ebenfalls zur Verf&uuml;gung.&nbsp;<br />\r\nDer riesige Misburger Wald und der Blaue See<br />\r\nsorgen f&uuml;r einen hohen Naherholungswert.</p>\r\n', 'Am Schachenwald', 350, 6, '830000', 430, '3.75', NULL, 1, 0, 12307, 'Haag in Oberbayern', 3, 2, 1, '2019-02-16 09:11:40', '2019-02-16 09:11:40', NULL, NULL),
(5, '<p><u><strong>Objektbeschreibung:</strong></u></p>\r\n\r\n<p>Sie suchen das Besondere?<br />\r\nEine repr&auml;sentative Immobilie in einer<br />\r\nder begehrtesten Wohngegenden Hannovers?&nbsp;<br />\r\nDieses Objekt hebt sich in allen Standards<br />\r\nab und bietet Ihnen ein ganz pers&ouml;nliches Wohnerlebnis.<br />\r\nIhre Immobilie befindet sich im 2. Obergeschoss<br />\r\nbzw. Staffelgeschoss (Penthaus) eines exklusiven<br />\r\nNeubauprojektes mit<br />\r\ngro&szlig;z&uuml;giger Dachterrasse in S&uuml;d/Ost Ausrichtung in gehobener Lage!<br />\r\nDie Wohnung verf&uuml;gt &uuml;ber einen PKW-Stellplatz<br />\r\nin der Tiefgarage, der mit angemietet werden kann.<br />\r\nTreten Sie ein und sp&uuml;ren Sie Schritt<br />\r\nf&uuml;r Schritt, warum das Wohnen hier so angenehm ist:</p>\r\n', '<p><strong>Energieausweis</strong></p>\r\n\r\n<p>Art: Bedarfsausweis<br />\r\nG&uuml;ltig bis: 15.10.2025<br />\r\nEndenergiebedarf: 41.00 kWh/(m&sup2;*a)<br />\r\nBaujahr lt. Energieausweis: 2014<br />\r\nWesentlicher Energietr&auml;ger: Gas</p>\r\n\r\n<p><strong><u>Lage:</u></strong></p>\r\n\r\n<p>Isernhagen-S&uuml;d z&auml;hlt zu den besten Adressen Hannovers.&nbsp;<br />\r\nDer besondere Vorzug von Isernhagen-S&uuml;d ist<br />\r\ndie Symbiose aus hervorragender Infrastruktur<br />\r\nund l&auml;ndlicher Lage.&nbsp;<br />\r\nEinkaufsm&ouml;glichkeiten, &Auml;rzte und Kindergarten<br />\r\nsowie die Stadtbahn sind fu&szlig;l&auml;ufig erreichbar.&nbsp;<br />\r\nDie A 2 und den Flughafen Langenhagen<br />\r\nerreichen Sie in wenigen Autominuten.&nbsp;<br />\r\nDas Angebot an Sport- und Freizeitclubs<br />\r\nund guten Restaurants in der malerischen<br />\r\nUmgebung der umliegenden Bauerschaften, l&auml;sst<br />\r\nkeine W&uuml;nsche offen.</p>\r\n', 'Zur Großen Wiese', 120, 3, '560', NULL, NULL, '275.00', 0, 0, 284, 'Cottbus', 3, 1, 1, '2019-02-16 09:14:32', '2019-02-16 09:14:32', NULL, NULL),
(6, '<p><u><strong>Objektbeschreibung:</strong></u></p>\r\n\r\n<p>Willkommen im Architekturhimmel f&uuml;r allerh&ouml;chste Anspr&uuml;che...<br />\r\nDiese Wohnresidenz bietet traumhaften Wohnkomfort<br />\r\nauf 255 qm mit herrlichem Blick ins Naturschutzgebiet.<br />\r\nH&ouml;chste Qualit&auml;t, edelste Materalien<br />\r\nund viel Liebe zum Detail schaffen meisterhaft<br />\r\ninszenierte R&auml;ume mit Deckenh&ouml;hen von 3,00 m.<br />\r\nDie gro&szlig;z&uuml;gigen Loggien sind so angeordnet,<br />\r\ndass sie ein Maximum an<br />\r\nPrivatsph&auml;re und an Ausblick bieten....</p>\r\n', '<p><u><strong>Energieausweis</strong></u>:<br />\r\nArt: Bedarfsausweis<br />\r\nG&uuml;ltig bis: 15.10.2025<br />\r\nEndenergiebedarf: 39.00 kWh/(m&sup2;*a)<br />\r\nWesentlicher Energietr&auml;ger: Gas<br />\r\nKlasse: A</p>\r\n\r\n<p><u><strong>Lage:</strong></u></p>\r\n\r\n<p>HIMMLISCHE RUHE UND VIEL GR&Uuml;N....<br />\r\nIsernhagen-S&uuml;d z&auml;hlt zu den besten<br />\r\nund begehrtesten Wohnlagen Hannovers.&nbsp;<br />\r\nDer besondere Vorzug ist die Symbiose<br />\r\naus hervorragender Infrastruktur<br />\r\nund l&auml;ndlicher Lage.<br />\r\nEinkaufsm&ouml;glichkeiten, &Auml;rzte und Kindergarten sowie<br />\r\ndie Stadtbahn sind fu&szlig;l&auml;ufig zu erreichen.</p>\r\n', 'Bahnhofstr.', 40, 2, '410', NULL, NULL, '80.00', 0, 1, 11487, 'Hüffenhardt', 4, 1, 2, '2019-02-16 09:17:24', '2019-02-16 09:17:24', NULL, NULL);
