INSERT INTO `rechnung` (`id`, `datumerstellung`, `datumfaellig`, `beschreibung`, `vorlage`, `geldbetrag`, `mwst_id`, `kunde_id`, `makler_id`, `kopf_id`, `rechungsart_id`, `rechnungPlain`, `aktualisiert_von`, `angelegt_von`, `aktualisiert_am`, `angelegt_am`) VALUES
(1, '2019-04-23', '2019-04-03', 'Diese Rechnung wurde unter Zuhilfenahme eines lizenzierten Webtools von unserem Makler Schröder erstellt. Im Falle von Reklamationen wenden Sie sich bitte telefonisch an 0176/2237330 oder per Mail an schroeder@gmx.net. Hinweise:Achten Sie auf das Fälligkeitsdatum der Rechnung.In den Paragraphen ab 688 der Zivilprozessordnung (ZPO) sind Widerspruchsregelungen enthalten.', 'Zwischen\r\n\r\nName _____________________________________________________________________________\r\nAdresse ___________________________________________________________________________\r\nTel _______________________________________________________________________________\r\n- Vermieter -\r\n\r\nund\r\n\r\nName _____________________________________________________________________________\r\nAdresse ___________________________________________________________________________\r\nTel _______________________________________________________________________________\r\n- Mieter -\r\n\r\nkommt nachfolgender Mietvertrag über Wohnraum zustande:\r\n\r\n\r\n§1  Mieträume\r\n   \r\nDer Vermieter vermietet dem Mieter zu Wohnzwecken die im Hause ___________________________________________________ (Adresse) im ____ Stock (rechts, links, Mitte) gelegene Wohnung (Nr. ____) bestehend aus _____ Zimmern, Küche, Diele, Bad/WC, (Kellerraum, Balkon, Terrasse, _______________ ). Die Wohn/Nutzfläche beträgt ca. _________ qm.\r\n\r\nMitvermietet wird der (Tief-)Garagenstellplatz Nr. ______________________ .\r\n\r\n\r\n§2  Mietzins und Nebenkosten\r\n\r\nDie monatliche Grundmiete beträgt                                                                ____________	EUR\r\nDie Kosten der (Tief-)Garage betragen monatlich                                         ____________	EUR\r\nNeben der Miete trägt der Mieter die Betriebskosten i.S.d.\r\nBetriebskostenverordnung (Betr.KV  s. Anlage 1)\r\n\r\nAuf diese Betriebskosten ist eine monatliche Vorauszahlung von              ____________	EUR\r\nzu zahlen.\r\n                                                                                                                         \r\nInsgesamt sind vom Mieter zu bezahlen:                                                       ____________  EUR\r\n \r\nÜber die Vorauszahlung für die Betriebskosten ist jährlich einmal durch den Vermieter oder Verwalter abzurechnen. Die Abrechnung erfolgt unverzüglich, sobald dem Vermieter/ Verwalter die zur Abrechnung notwendigen Unterlagen vorliegen. \r\nErhöhen sich die Betriebskosten, so ist der Vermieter berechtigt, diese im Rahmen der gesetzlichen Vorschriften umzulegen und eine entsprechende Erhöhung der Vorauszahlungen zu verlangen.\r\n\r\n\r\n§3  Zahlung der Miete und Nebenkosten\r\n\r\nMiete und Nebenkosten sind ab Beginn der Mietzeit monatlich im Voraus, spätestens bis zum dritten Werktag eines Monats für den Vermieter kostenfrei auf das Konto des Vermieters\r\n\r\nKontoinhaber: ______________________________________________________________________\r\nBank: _____________________________________________________________________________\r\nIBAN: _____________________________________________________________________________\r\nBIC: _______________________________________________________________________________\r\n\r\nzu überweisen. Ausschlaggebender Zeitpunkt ist die Wertstellung auf dem Konto des Vermieters, nicht der Tag der Absendung.\r\n\r\n\r\n§4  Mietdauer\r\n\r\nDas Mietverhältnis beginnt am _______________ und läuft auf unbestimmte Zeit. Das Recht zur Kündigung bestimmt sich nach den gesetzlichen Vorschriften.\r\nEine Kündigung hat schriftlich zu erfolgen. \r\n\r\n\r\n§5  Mietsicherheit\r\n\r\nDer Mieter ist verpflichtet, dem Vermieter bei Beginn des Mietverhältnisses eine Mietsicherheit (Kaution) in Höhe von EUR ____________ zu leisten.\r\nDieses kann in Form der Hinterlegung eines Sparbuchs, einer Bankbürgschaft oder durch Barbezahlung/Überweisung an den Vermieter erfolgen.\r\n\r\n\r\n§6  Zustand der Mieträume\r\n\r\nDer Vermieter gewährt dem Mieter den Gebrauch der Mietsache in dem Zustand bei Übergabe. Dieser Zustand ist dem Vermieter bei Übergabe der Mietsache bekannt und wird in einem Protokoll festgehalten, welches wesentlicher Bestandteil des Mietvertrages ist.\r\n (s. Anlage 3)\r\nZu Beginn des Mietverhältnisses bekannte Mängel an der Mietsache werden vom Mieter als vertragsgemäß anerkannt. Eine verschuldensunabhängige Haftung des Vermieters für anfängliche Mängel wird ausgeschlossen.\r\nSollten noch Restarbeiten an der Mietsache durch den Vermieter durchzuführen sein, so kann die Übergabe der Mietsache an den Mieter nicht verweigert werden, sofern die Nutzung als Wohnung nur unerheblich beeinträchtigt ist.\r\n\r\n\r\n§7  Schönheitsreparaturen\r\n\r\n1. Während der Dauer des Mietverhältnisses übernimmt der Mieter die Kosten der Schönheitsreparaturen.\r\n\r\nZu den Schönheitsreparaturen gehören insbesondere das Anstreichen bzw. Tapezieren der Wände und Decken sowie der Innentüren, das Lackieren der Heizkörper und Heizrohre und der Fenster und Außentüren von innen.\r\n\r\nIn der Regel sind Schönheitsreparaturen durchzuführen\r\n-in Küchen, Bädern und Duschen alle 3 Jahre\r\n-in Wohn- und Schlafräumen, Fluren, Dielen und Toiletten alle 5 Jahre\r\n-in allen sonstigen Nebenräumen alle 7 Jahre.\r\n\r\nDie Schönheitsreparaturen sind, soweit erforderlich, in fachgerechter „mittlerer Art und Güte“ nach § 243 BGB zu leisten und richten sich im konkreten Fall nach dem Renovierungsbedarf, d.h. je nach Zustand früher oder später.\r\n\r\n\r\n§8  Instandhaltung der Mietsache\r\n\r\n1. Der Mieter ist verpflichtet, die Mietsache und die gemeinschaftlichen Einrichtungen und Anlagen pfleglich und schonend zu behandeln.\r\nSchäden am Haus und in den Mieträumen sind dem Vermieter unverzüglich anzuzeigen. Für durch verspätete Anzeige verursachte weitere Schäden haftet der Mieter.\r\n\r\n2. Der Mieter hat für ordnungsgemäße Reinigung der Mieträume sowie deren ausreichende Beheizung und Belüftung sowie Schutz der Innenräume vor Frost zu sorgen.\r\n\r\nDer Mieter haftet dem Vermieter für Schäden, die durch die Verletzung seiner ihm obliegenden Obhuts-, Sorgfalts- und Anzeigepflicht schuldhaft verursacht werden. Er haftet in gleicher Weise für Schäden, die durch seine Angehörigen, Untermieter, Arbeiter, Angestellten, Handwerker und Personen, die sich mit seinem Willen in der Wohnung aufhalten oder ihn aufsuchen, verursacht werden.\r\nHat der Mieter oder der vorgenannte Personenkreis einen Schaden an der Mietsache verursacht, so hat er diesen unverzüglich dem Vermieter anzuzeigen.\r\n\r\nDer Mieter hat Schäden, für die er einstehen muss, unverzüglich zu beseitigen. Kommt er dieser Verpflichtung auch nach schriftlicher Mahnung innerhalb einer angemessenen Frist nicht nach, so kann der Vermieter die erforderlichen Arbeiten auf Kosten des Mieters vornehmen lassen.\r\nDer Mieter hat zu beweisen, dass ein Verschulden seinerseits nicht vorgelegen hat.\r\n\r\n\r\n§9  Benutzung der Mietsache\r\n\r\n1. Der Mieter darf die angemieteten Räume zu anderen als zu Wohnzwecken nur mit Erlaubnis des Vermieters benutzen. \r\nEine Zustimmung des Vermieters ist ebenfalls erforderlich, wenn der Mieter an der Mietsache Um-, An-, und Einbauten, Installationen oder andere Veränderungen vornehmen will.\r\n\r\n2. Die Parteien sind sich darüber einig, dass eine Untervermietung oder die Überlassung der Mietsache an Dritte der Zustimmung des Vermieters bedarf. \r\n\r\n3. Die Haltung von Kleintieren ist dem Mieter ohne Zustimmung des Vermieters gestattet, soweit durch die Unterbringung in den Mieträumen eine Beeinträchtigung der Mietsache oder eine Belästigung von Hausbewohnern oder Nachbarn nicht gegeben ist. \r\nDie Haltung von Hunden und Katzen sowie anderer als Tiere bedarf der Zustimmung des Vermieters. \r\n\r\n\r\n§10  Bagatellschäden/Kleinreparaturen\r\n\r\nDie Kosten für die Reparatur von Bagatellschäden trägt der Mieter ohne Rücksicht auf ein Verschulden bis zu der nachfolgend angegebenen Höhe. Es handelt sich hierbei um die Instandhaltungskosten an denjenigen Gegenständen und Einrichtungen, die seinem direkten und häufigen Gebrauch unterliegen wie Installationseinrichtungen für Wasser, Strom, Gas, Heiz- und Kocheinrichtungen sowie Rollläden, Jalousien, Fensterläden und Markisen und Fenster und Türverschlüsse.\r\n\r\nDie Obergrenze für eine Reparatur beträgt im Einzelfall 95,- EUR inkl. MwSt., bei mehreren Kleinreparaturen maximal 300,-EUR inkl. MwSt. im Jahr, maximal aber nicht mehr als 8% der Jahresmiete (Kalt).\r\n\r\n\r\n§11 Kündigung\r\n\r\n1. Auf die Kündigung des Mietvertrags finden die Vorschriften der §§ 573 ff BGB Anwendung.\r\nDie Kündigung hat in schriftlicher Form zu erfolgen.\r\n\r\n2. Setzt der Mieter den Gebrauch der Mietsache fort, so gilt das Mietverhältnis nicht als verlängert. Die entsprechende Vorschrift des § 545 BGB findet insoweit keine Anwendung.\r\n\r\n\r\n§12  Betreten der Mietsache durch den Vermieter\r\n\r\nDer Vermieter oder ein von ihm Beauftragter darf die Mietsache aus wichtigem Grund und nach rechtzeitiger Ankündigung betreten, um unter anderem ihren Zustand zu überprüfen oder die Ablesung von Messgeräten oder  Reparatur –bzw. Instandshaltungsmaßnahmen vorzunehmen.\r\n\r\n\r\n§13  Personenmehrheit als Vertragspartei\r\n\r\n1. Besteht eine Mietpartei aus mehreren Personen, so haften sie für alle Verpflichtungen aus dem Mietverhältnis als Gesamtschuldner.\r\n\r\n2. Erklärungen, deren Wirkung die einzelnen Mieter aus dem Mietverhältnis berühren, müssen von und gegenüber allen abgegeben werden. Die Mieter bevollmächtigen sich jedoch - unter Vorbehalt eines schriftlichen Widerrufs – bis auf weiteres gegenseitig zur Entgegennahme oder Abgabe solcher Erklärungen. Dies gilt auch für die Entgegennahme von Kündigungen, nicht jedoch für deren Abgabe oder für den  Abschluss eines Mietaufhebungsvertrages.\r\n\r\n\r\n\r\n\r\n\r\n§14  Hausordnung\r\n\r\nDie Parteien sind sich darüber einig, dass die bei Abschluss des Mietvertrages dem Mieter übergebene Hausordnung (Anlage 2) zum wesentlichen Bestandteil des Mietvertrags wird.\r\n\r\n\r\n§15  Beendigung des Mietverhältnisses \r\n\r\n1. Rückgabe der Mietsache\r\nDer Mieter hat dem Vermieter die Mietsache vollständig geräumt und gereinigt und mit sämtlichen, auch den vom Mieter beschafften, Schlüsseln zu einem von beiden Parteien vereinbarten Termin zu übergeben. Über die Übergabe ist ein Protokoll zu erstellen (s. Anlage3 A)\r\n\r\n2. Der Mieter hat dafür Sorge zu tragen, dass bei allen in der Mietsache befindlichen Messgeräten  (Heizung, Warm-, Kaltwasser etc.) auf seine Kosten eine Zwischenablesung stattgefunden hat. Das Protokoll über die Zwischenablesung ist dem Vermieter bei der Übergabe auszuhändigen.\r\n\r\n3. Bauliche Veränderungen an der Mietsache oder Einrichtungen sind auf Verlangen des Vermieters vom Mieter zu entfernen bzw. der ursprüngliche Zustand wiederherzustellen.\r\n\r\n4. Falls der Mieter bereits die in §7 dieses Vertrages Schönheitsreparaturen durchgeführt hat und eine erneute Durchführung dieser Arbeiten turnusgemäß noch nicht fällig ist, so kann der Vermieter zeitanteilig einen geldwerten Ersatz hierfür verlangen, sofern die Notwendigkeit zu erneuten Schönheitsreparaturen bestehen sollte. Der Mieter kann diesen Anspruch vermeiden, wenn er selbst diese Arbeiten vornimmt oder vornehmen lässt.\r\n\r\nFalls die Schönheitsreparaturen vom Mieter durchzuführen sind, hat er die Verpflichtung, diese in fachgerechter „mittlerer Art und Güte“ vorzunehmen oder vornehmen zu lassen.\r\n\r\n5. Wird bei der Übergabe der Mietsache ein Schaden an dieser oder den Einrichtungen festgestellt, und dem Mieter trifft hierfür ein Verschulden, so ist der Mieter zum Ersatz des entstandenen Schadens abzüglich der allgemein üblichen Nutzungsdauer verpflichtet.\r\n\r\n\r\n§16  Schriftform/Salvatorische Klausel\r\n\r\n1. Die Parteien sind sich ausdrücklich darüber einig, dass zu diesem Vertrag keinerlei mündliche Nebenabreden bestehen und jegliche Änderungen oder Ergänzungen der Schriftform bedürfen. \r\n\r\n2. Sollten Klauseln aus diesem Vertrag nebst Anlagen unwirksam sein oder werden, so sind sich die Parteien darüber einig, dass die übrigen Klauseln aus dem Vertrag ihre Gültigkeit behalten sollen. Die unwirksame Klausel wird dann durch eine solche ersetzt, die dem wirtschaftlich gewollten Inhalt in rechtlich zulässiger Weise entspricht.\r\n\r\n\r\n§17  Individuelle Vereinbarungen\r\n\r\n__________________________________________________________________________________\r\n_________________________________________________________________________________\r\n__________________________________________________________________________________\r\n\r\n§18 Anlagen als Vertragsbestandteil\r\n\r\n1. Betriebskostenanlage (Anlage 1)\r\n2. Hausordnung (Anlage 2)\r\n3. Wohnungsübergabeprotokoll (Anlage 3)\r\n\r\n\r\n\r\n\r\n\r\n______________________ ,  den ___________________\r\n\r\n\r\n\r\n\r\n\r\n\r\n_______________________________                                    _______________________________\r\nVermieter						     Mieter\r\n', '6000', 1, 2, 4, 2, 1, '<div>Zwischen</div>\r\n\r\n<div>Name _____________________________________________________________________________<br />\r\nAdresse ___________________________________________________________________________<br />\r\nTel _______________________________________________________________________________<br />\r\n- Vermieter -</div>\r\n\r\n<div>und</div>\r\n\r\n<div>Name _____________________________________________________________________________<br />\r\nAdresse ___________________________________________________________________________<br />\r\nTel _______________________________________________________________________________<br />\r\n- Mieter -</div>\r\n\r\n<div>kommt nachfolgender Mietvertrag &uuml;ber Wohnraum zustande:</div>\r\n\r\n<div><br />\r\n&sect;1&nbsp; Mietr&auml;ume<br />\r\n&nbsp;&nbsp;<br />\r\nDer Vermieter vermietet dem Mieter zu Wohnzwecken die im Hause ___________________________________________________ (Adresse) im ____ Stock (rechts, links, Mitte) gelegene Wohnung (Nr. ____) bestehend aus _____ Zimmern, K&uuml;che, Diele, Bad/WC, (Kellerraum, Balkon, Terrasse, _______________ ). Die Wohn/Nutzfl&auml;che betr&auml;gt ca. _________ qm.</div>\r\n\r\n<div>Mitvermietet wird der (Tief-)Garagenstellplatz Nr. ______________________ .</div>\r\n\r\n<div><br />\r\n&sect;2&nbsp; Mietzins und Nebenkosten</div>\r\n\r\n<div>Die monatliche Grundmiete betr&auml;gt&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ____________&nbsp;EUR<br />\r\nDie Kosten der (Tief-)Garage betragen monatlich&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ____________&nbsp;EUR<br />\r\nNeben der Miete tr&auml;gt der Mieter die Betriebskosten i.S.d.<br />\r\nBetriebskostenverordnung (Betr.KV&nbsp; s. Anlage 1)</div>\r\n\r\n<div>Auf diese Betriebskosten ist eine monatliche Vorauszahlung von&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ____________&nbsp;EUR<br />\r\nzu zahlen.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\nInsgesamt sind vom Mieter zu bezahlen:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ____________&nbsp; EUR<br />\r\n&nbsp;<br />\r\n&Uuml;ber die Vorauszahlung f&uuml;r die Betriebskosten ist j&auml;hrlich einmal durch den Vermieter oder Verwalter abzurechnen. Die Abrechnung erfolgt unverz&uuml;glich, sobald dem Vermieter/ Verwalter die zur Abrechnung notwendigen Unterlagen vorliegen.<br />\r\nErh&ouml;hen sich die Betriebskosten, so ist der Vermieter berechtigt, diese im Rahmen der gesetzlichen Vorschriften umzulegen und eine entsprechende Erh&ouml;hung der Vorauszahlungen zu verlangen.</div>\r\n\r\n<div><br />\r\n&sect;3&nbsp; Zahlung der Miete und Nebenkosten</div>\r\n\r\n<div>Miete und Nebenkosten sind ab Beginn der Mietzeit monatlich im Voraus, sp&auml;testens bis zum dritten Werktag eines Monats f&uuml;r den Vermieter kostenfrei auf das Konto des Vermieters</div>\r\n\r\n<div>Kontoinhaber: ______________________________________________________________________<br />\r\nBank: _____________________________________________________________________________<br />\r\nIBAN: _____________________________________________________________________________<br />\r\nBIC: _______________________________________________________________________________</div>\r\n\r\n<div>zu &uuml;berweisen. Ausschlaggebender Zeitpunkt ist die Wertstellung auf dem Konto des Vermieters, nicht der Tag der Absendung.</div>\r\n\r\n<div><br />\r\n&sect;4&nbsp; Mietdauer</div>\r\n\r\n<div>Das Mietverh&auml;ltnis beginnt am _______________ und l&auml;uft auf unbestimmte Zeit. Das Recht zur K&uuml;ndigung bestimmt sich nach den gesetzlichen Vorschriften.<br />\r\nEine K&uuml;ndigung hat schriftlich zu erfolgen.</div>\r\n\r\n<div><br />\r\n&sect;5&nbsp; Mietsicherheit</div>\r\n\r\n<div>Der Mieter ist verpflichtet, dem Vermieter bei Beginn des Mietverh&auml;ltnisses eine Mietsicherheit (Kaution) in H&ouml;he von EUR ____________ zu leisten.<br />\r\nDieses kann in Form der Hinterlegung eines Sparbuchs, einer Bankb&uuml;rgschaft oder durch Barbezahlung/&Uuml;berweisung an den Vermieter erfolgen.</div>\r\n\r\n<div><br />\r\n&sect;6&nbsp; Zustand der Mietr&auml;ume</div>\r\n\r\n<div>Der Vermieter gew&auml;hrt dem Mieter den Gebrauch der Mietsache in dem Zustand bei &Uuml;bergabe. Dieser Zustand ist dem Vermieter bei &Uuml;bergabe der Mietsache bekannt und wird in einem Protokoll festgehalten, welches wesentlicher Bestandteil des Mietvertrages ist.<br />\r\n&nbsp;(s. Anlage 3)<br />\r\nZu Beginn des Mietverh&auml;ltnisses bekannte M&auml;ngel an der Mietsache werden vom Mieter als vertragsgem&auml;&szlig; anerkannt. Eine verschuldensunabh&auml;ngige Haftung des Vermieters f&uuml;r anf&auml;ngliche M&auml;ngel wird ausgeschlossen.<br />\r\nSollten noch Restarbeiten an der Mietsache durch den Vermieter durchzuf&uuml;hren sein, so kann die &Uuml;bergabe der Mietsache an den Mieter nicht verweigert werden, sofern die Nutzung als Wohnung nur unerheblich beeintr&auml;chtigt ist.</div>\r\n\r\n<div><br />\r\n&sect;7&nbsp; Sch&ouml;nheitsreparaturen</div>\r\n\r\n<div>1. W&auml;hrend der Dauer des Mietverh&auml;ltnisses &uuml;bernimmt der Mieter die Kosten der Sch&ouml;nheitsreparaturen.</div>\r\n\r\n<div>Zu den Sch&ouml;nheitsreparaturen geh&ouml;ren insbesondere das Anstreichen bzw. Tapezieren der W&auml;nde und Decken sowie der Innent&uuml;ren, das Lackieren der Heizk&ouml;rper und Heizrohre und der Fenster und Au&szlig;ent&uuml;ren von innen.</div>\r\n\r\n<div>In der Regel sind Sch&ouml;nheitsreparaturen durchzuf&uuml;hren<br />\r\n-in K&uuml;chen, B&auml;dern und Duschen alle 3 Jahre<br />\r\n-in Wohn- und Schlafr&auml;umen, Fluren, Dielen und Toiletten alle 5 Jahre<br />\r\n-in allen sonstigen Nebenr&auml;umen alle 7 Jahre.</div>\r\n\r\n<div>Die Sch&ouml;nheitsreparaturen sind, soweit erforderlich, in fachgerechter &bdquo;mittlerer Art und G&uuml;te&ldquo; nach &sect; 243 BGB zu leisten und richten sich im konkreten Fall nach dem Renovierungsbedarf, d.h. je nach Zustand fr&uuml;her oder sp&auml;ter.</div>\r\n\r\n<div><br />\r\n&sect;8&nbsp; Instandhaltung der Mietsache</div>\r\n\r\n<div>1. Der Mieter ist verpflichtet, die Mietsache und die gemeinschaftlichen Einrichtungen und Anlagen pfleglich und schonend zu behandeln.<br />\r\nSch&auml;den am Haus und in den Mietr&auml;umen sind dem Vermieter unverz&uuml;glich anzuzeigen. F&uuml;r durch versp&auml;tete Anzeige verursachte weitere Sch&auml;den haftet der Mieter.</div>\r\n\r\n<div>2. Der Mieter hat f&uuml;r ordnungsgem&auml;&szlig;e Reinigung der Mietr&auml;ume sowie deren ausreichende Beheizung und Bel&uuml;ftung sowie Schutz der Innenr&auml;ume vor Frost zu sorgen.</div>\r\n\r\n<div>Der Mieter haftet dem Vermieter f&uuml;r Sch&auml;den, die durch die Verletzung seiner ihm obliegenden Obhuts-, Sorgfalts- und Anzeigepflicht schuldhaft verursacht werden. Er haftet in gleicher Weise f&uuml;r Sch&auml;den, die durch seine Angeh&ouml;rigen, Untermieter, Arbeiter, Angestellten, Handwerker und Personen, die sich mit seinem Willen in der Wohnung aufhalten oder ihn aufsuchen, verursacht werden.<br />\r\nHat der Mieter oder der vorgenannte Personenkreis einen Schaden an der Mietsache verursacht, so hat er diesen unverz&uuml;glich dem Vermieter anzuzeigen.</div>\r\n\r\n<div>Der Mieter hat Sch&auml;den, f&uuml;r die er einstehen muss, unverz&uuml;glich zu beseitigen. Kommt er dieser Verpflichtung auch nach schriftlicher Mahnung innerhalb einer angemessenen Frist nicht nach, so kann der Vermieter die erforderlichen Arbeiten auf Kosten des Mieters vornehmen lassen.<br />\r\nDer Mieter hat zu beweisen, dass ein Verschulden seinerseits nicht vorgelegen hat.</div>\r\n\r\n<div><br />\r\n&sect;9&nbsp; Benutzung der Mietsache</div>\r\n\r\n<div>1. Der Mieter darf die angemieteten R&auml;ume zu anderen als zu Wohnzwecken nur mit Erlaubnis des Vermieters benutzen.<br />\r\nEine Zustimmung des Vermieters ist ebenfalls erforderlich, wenn der Mieter an der Mietsache Um-, An-, und Einbauten, Installationen oder andere Ver&auml;nderungen vornehmen will.</div>\r\n\r\n<div>2. Die Parteien sind sich dar&uuml;ber einig, dass eine Untervermietung oder die &Uuml;berlassung der Mietsache an Dritte der Zustimmung des Vermieters bedarf.</div>\r\n\r\n<div>3. Die Haltung von Kleintieren ist dem Mieter ohne Zustimmung des Vermieters gestattet, soweit durch die Unterbringung in den Mietr&auml;umen eine Beeintr&auml;chtigung der Mietsache oder eine Bel&auml;stigung von Hausbewohnern oder Nachbarn nicht gegeben ist.<br />\r\nDie Haltung von Hunden und Katzen sowie anderer als Tiere bedarf der Zustimmung des Vermieters.</div>\r\n\r\n<div><br />\r\n&sect;10&nbsp; Bagatellsch&auml;den/Kleinreparaturen</div>\r\n\r\n<div>Die Kosten f&uuml;r die Reparatur von Bagatellsch&auml;den tr&auml;gt der Mieter ohne R&uuml;cksicht auf ein Verschulden bis zu der nachfolgend angegebenen H&ouml;he. Es handelt sich hierbei um die Instandhaltungskosten an denjenigen Gegenst&auml;nden und Einrichtungen, die seinem direkten und h&auml;ufigen Gebrauch unterliegen wie Installationseinrichtungen f&uuml;r Wasser, Strom, Gas, Heiz- und Kocheinrichtungen sowie Rolll&auml;den, Jalousien, Fensterl&auml;den und Markisen und Fenster und T&uuml;rverschl&uuml;sse.</div>\r\n\r\n<div>Die Obergrenze f&uuml;r eine Reparatur betr&auml;gt im Einzelfall 95,- EUR inkl. MwSt., bei mehreren Kleinreparaturen maximal 300,-EUR inkl. MwSt. im Jahr, maximal aber nicht mehr als 8% der Jahresmiete (Kalt).</div>\r\n\r\n<div><br />\r\n&sect;11 K&uuml;ndigung</div>\r\n\r\n<div>1. Auf die K&uuml;ndigung des Mietvertrags finden die Vorschriften der &sect;&sect; 573 ff BGB Anwendung.<br />\r\nDie K&uuml;ndigung hat in schriftlicher Form zu erfolgen.</div>\r\n\r\n<div>2. Setzt der Mieter den Gebrauch der Mietsache fort, so gilt das Mietverh&auml;ltnis nicht als verl&auml;ngert. Die entsprechende Vorschrift des &sect; 545 BGB findet insoweit keine Anwendung.</div>\r\n\r\n<div><br />\r\n&sect;12&nbsp; Betreten der Mietsache durch den Vermieter</div>\r\n\r\n<div>Der Vermieter oder ein von ihm Beauftragter darf die Mietsache aus wichtigem Grund und nach rechtzeitiger Ank&uuml;ndigung betreten, um unter anderem ihren Zustand zu &uuml;berpr&uuml;fen oder die Ablesung von Messger&auml;ten oder&nbsp; Reparatur &ndash;bzw. Instandshaltungsma&szlig;nahmen vorzunehmen.</div>\r\n\r\n<div><br />\r\n&sect;13&nbsp; Personenmehrheit als Vertragspartei</div>\r\n\r\n<div>1. Besteht eine Mietpartei aus mehreren Personen, so haften sie f&uuml;r alle Verpflichtungen aus dem Mietverh&auml;ltnis als Gesamtschuldner.</div>\r\n\r\n<div>2. Erkl&auml;rungen, deren Wirkung die einzelnen Mieter aus dem Mietverh&auml;ltnis ber&uuml;hren, m&uuml;ssen von und gegen&uuml;ber allen abgegeben werden. Die Mieter bevollm&auml;chtigen sich jedoch - unter Vorbehalt eines schriftlichen Widerrufs &ndash; bis auf weiteres gegenseitig zur Entgegennahme oder Abgabe solcher Erkl&auml;rungen. Dies gilt auch f&uuml;r die Entgegennahme von K&uuml;ndigungen, nicht jedoch f&uuml;r deren Abgabe oder f&uuml;r den&nbsp; Abschluss eines Mietaufhebungsvertrages.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&sect;14&nbsp; Hausordnung</div>\r\n\r\n<div>Die Parteien sind sich dar&uuml;ber einig, dass die bei Abschluss des Mietvertrages dem Mieter &uuml;bergebene Hausordnung (Anlage 2) zum wesentlichen Bestandteil des Mietvertrags wird.</div>\r\n\r\n<div><br />\r\n&sect;15&nbsp; Beendigung des Mietverh&auml;ltnisses</div>\r\n\r\n<div>1. R&uuml;ckgabe der Mietsache<br />\r\nDer Mieter hat dem Vermieter die Mietsache vollst&auml;ndig ger&auml;umt und gereinigt und mit s&auml;mtlichen, auch den vom Mieter beschafften, Schl&uuml;sseln zu einem von beiden Parteien vereinbarten Termin zu &uuml;bergeben. &Uuml;ber die &Uuml;bergabe ist ein Protokoll zu erstellen (s. Anlage3 A)</div>\r\n\r\n<div>2. Der Mieter hat daf&uuml;r Sorge zu tragen, dass bei allen in der Mietsache befindlichen Messger&auml;ten&nbsp; (Heizung, Warm-, Kaltwasser etc.) auf seine Kosten eine Zwischenablesung stattgefunden hat. Das Protokoll &uuml;ber die Zwischenablesung ist dem Vermieter bei der &Uuml;bergabe auszuh&auml;ndigen.</div>\r\n\r\n<div>3. Bauliche Ver&auml;nderungen an der Mietsache oder Einrichtungen sind auf Verlangen des Vermieters vom Mieter zu entfernen bzw. der urspr&uuml;ngliche Zustand wiederherzustellen.</div>\r\n\r\n<div>4. Falls der Mieter bereits die in &sect;7 dieses Vertrages Sch&ouml;nheitsreparaturen durchgef&uuml;hrt hat und eine erneute Durchf&uuml;hrung dieser Arbeiten turnusgem&auml;&szlig; noch nicht f&auml;llig ist, so kann der Vermieter zeitanteilig einen geldwerten Ersatz hierf&uuml;r verlangen, sofern die Notwendigkeit zu erneuten Sch&ouml;nheitsreparaturen bestehen sollte. Der Mieter kann diesen Anspruch vermeiden, wenn er selbst diese Arbeiten vornimmt oder vornehmen l&auml;sst.</div>\r\n\r\n<div>Falls die Sch&ouml;nheitsreparaturen vom Mieter durchzuf&uuml;hren sind, hat er die Verpflichtung, diese in fachgerechter &bdquo;mittlerer Art und G&uuml;te&ldquo; vorzunehmen oder vornehmen zu lassen.</div>\r\n\r\n<div>5. Wird bei der &Uuml;bergabe der Mietsache ein Schaden an dieser oder den Einrichtungen festgestellt, und dem Mieter trifft hierf&uuml;r ein Verschulden, so ist der Mieter zum Ersatz des entstandenen Schadens abz&uuml;glich der allgemein &uuml;blichen Nutzungsdauer verpflichtet.</div>\r\n\r\n<div><br />\r\n&sect;16&nbsp; Schriftform/Salvatorische Klausel</div>\r\n\r\n<div>1. Die Parteien sind sich ausdr&uuml;cklich dar&uuml;ber einig, dass zu diesem Vertrag keinerlei m&uuml;ndliche Nebenabreden bestehen und jegliche &Auml;nderungen oder Erg&auml;nzungen der Schriftform bed&uuml;rfen.</div>\r\n\r\n<div>2. Sollten Klauseln aus diesem Vertrag nebst Anlagen unwirksam sein oder werden, so sind sich die Parteien dar&uuml;ber einig, dass die &uuml;brigen Klauseln aus dem Vertrag ihre G&uuml;ltigkeit behalten sollen. Die unwirksame Klausel wird dann durch eine solche ersetzt, die dem wirtschaftlich gewollten Inhalt in rechtlich zul&auml;ssiger Weise entspricht.</div>\r\n\r\n<div><br />\r\n&sect;17&nbsp; Individuelle Vereinbarungen</div>\r\n\r\n<div>__________________________________________________________________________________<br />\r\n_________________________________________________________________________________<br />\r\n__________________________________________________________________________________</div>\r\n\r\n<div>&sect;18 Anlagen als Vertragsbestandteil</div>\r\n\r\n<div>1. Betriebskostenanlage (Anlage 1)<br />\r\n2. Hausordnung (Anlage 2)<br />\r\n3. Wohnungs&uuml;bergabeprotokoll (Anlage 3)</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>______________________ ,&nbsp; den ___________________</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div><br />\r\n_______________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; _______________________________</div>\r\n\r\n<div>Vermieter&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mieter</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Diese Rechnung wurde unter Zuhilfenahme eines lizenzierten Webtools von unserem Makler Schr&ouml;der erstellt. Im Falle von Reklamationen wenden Sie sich bitte telefonisch an 0176/2237330 oder per Mail an schroeder@gmx.net. Hinweise:Achten Sie auf das F&auml;lligkeitsdatum der Rechnung.In den Paragraphen ab 688 der Zivilprozessordnung (ZPO) sind Widerspruchsregelungen enthalten.</div>\r\n', 4, 4, '2019-04-01 16:48:41', '2019-04-01 16:37:55');
